def fav_lang(repos):
    FavLang = "None"
    langs = {}
    for repo in repos:
        langs[repo["language"]] = langs.get(repo["language"], 0) + 1
    maxFreq = 0
    for lang, freq in langs.items():
        if freq > maxFreq:
            FavLang = lang
            maxFreq = freq
    return FavLang


